import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';

export default function Services() {
  return (
    <Router>
        <Footer />
        <Switch>

          <Route path='/Hero' component={HeroSection} />
        </Switch>
      </Router>
  );
}
